def load_peptide_data_nci60(file_name, file_directory_path = '../../data/external_networks/'):
	# whole_data = np.genfromtxt(os.path.join(file_directory_path, file_name), delimiter = '\t', dtype='str')
	whole_data = np.loadtxt(os.path.join(file_directory_path, file_name), delimiter = '\t', dtype= np.ndarray)
	print('whole_data shape', whole_data.shape)
	genes_list, header, data = whole_data[1:, 2], whole_data[0, :], whole_data[1:, :]
	
	gene_ids = []
	# gene_names = []
	skip_rows = set()
	duplicate_rows = []

	for idx, genes in enumerate(genes_list):
		# print(genes)
		genes = genes.split(',')
		for gene_idx, gene in enumerate(genes):
			gene_ids.append(gene)
			# gene_names.append(gene)
			if gene_idx > 0:
				duplicate_rows.append(idx)
		

	keep_indices = set(range(0, len(genes_list)))
	keep_indices.difference_update(skip_rows)

	keep_indices = list(keep_indices)
	keep_indices.extend(duplicate_rows)
	keep_indices.sort()

	data = np.array(data[keep_indices]) #skip genes for which mapping is not available
	data = np.append(np.expand_dims(gene_ids, axis = 1), data[:, 1:], axis = 1)

	return header, data

def load_peptide_data_tissue29(file_name, file_directory_path = '../../data/external_networks/'):
	# whole_data = np.genfromtxt(os.path.join(file_directory_path, file_name), delimiter = '\t', dtype='str')
	whole_data = np.loadtxt(os.path.join(file_directory_path, file_name), delimiter = '\t', dtype= np.ndarray)
	print('whole_data shape', whole_data.shape)
	gene_index = 2
	genes_list, header, data = whole_data[1:, gene_index], whole_data[0, :], whole_data[1:, :]
	server = Server(host='http://www.ensembl.org')
	dataset = (server.marts['ENSEMBL_MART_ENSEMBL'].datasets['hsapiens_gene_ensembl'])
	# print(dataset.list_attributes()[0:1000].to_string())
	# print(dataset.list_attributes().head(100).to_string())
	data_array = dataset.query(attributes=['ensembl_peptide_id', 'external_gene_name']).to_numpy()
	
	mapping = dict()
	
	for data_ in data_array:
		mapping[data_[0]] = data_[1]

	# print(mapping)
	
	gene_ids = []
	# gene_names = []
	skip_rows = set()
	duplicate_rows = []

	for idx, genes in enumerate(genes_list):
		# print(genes)
		genes = genes.split(',')
		# print(genes)
		for gene_idx, gene in enumerate(genes):
			genes_split = gene.split('.')
			gene = genes_split[0]
			# print('gene', genes_split)
			if gene in mapping:
				gene_ids.append(mapping[gene])
				duplicate_rows.append(idx)
			else:
				skip_rows.add(idx)

	# print('duplicate_rows', len(duplicate_rows), duplicate_rows)
	# print('skip_rows', len(skip_rows))
	# print('genes_list', len(genes_list))
	
	# keep_indices = set(range(0, len(genes_list)))
	keep_indices = duplicate_rows
	# keep_indices.difference_update(skip_rows)

	# keep_indices = list(keep_indices)
	# keep_indices.extend(duplicate_rows)
	keep_indices.sort()

	# print('keep_indices', keep_indices)
	# print('gene_ids', gene_ids)
	
	data = np.array(data[keep_indices]) #skip genes for which mapping is not available
	data = np.append(np.expand_dims(gene_ids, axis = 1), data[:, 1:], axis = 1)

	return header, data


